def extract(text):
	positive_count = 0
	negative_count = 0
	word_count = 0
	uppercase_count = 0
	lowercase_count = 0
	punctuation_count = 0
	onegram_score = 0
	onegram_count = 0
	bigram_score = 0
	bigram_count = 0
	character_count = 0
	alpha_count = 0
	num_count = 0

	"""normalize words by lowercasing and dropping non-alpha characters"""
	norm = lambda word: re.sub('[^a-z]', '', word.lower())

	"""create a list of lowercase words from the input text, and remove empty strings"""
	words = list(norm(word) for word in text.split() if word != '')
	
	"""build a list of bigrams by pairing words in the text"""
	bigrams = zip(words[0::2],words[1::2])+zip(words[1::2],words[2::2])

	"""process each word in the text"""
	for word in words:
		if word not in stop_words and word in onegram_positivity_index:

			onegram_score += onegram_positivity_index[word]
			onegram_count += 1
			word_count += 1
			if word in positive_words:
					positive_count += 1
			if word in negative_words:
					negative_count += 1

	"""process each character in the text"""
	for character in text:
		character_count += 1
		if character.isdigit():
			num_count += 1
		if character.isalpha():
			alpha_count += 1
			if character.islower():
				lowercase_count+=1
			else:
				uppercase_count += 1
		if character == "!" or character == "?":
			punctuation_count += 1

	"""process each bigram in the text"""
	for bigram in bigrams:
		if bigram in bigram_positivity_index:
			bigram_count += 1
			bigram_score += bigram_positivity_index[bigram]

	"""Checks to prevent divide by zero errors"""
	if onegram_count == 0:
		onegram_score = 0
	else:
		onegram_score = int(onegram_score*1.0/onegram_count)
	if bigram_count == 0:
		bigram_score = 0
	else:
		bigram_score = int(bigram_score*1.0/bigram_count)
	if lowercase_count == 0:
		upper_to_lower = 0
	else:
		upper_to_lower = (uppercase_count*100.0/lowercase_count)
	if character_count == 0:
		alpha_to_char = 0
	else:
		alpha_to_char = (float(alpha_count*100.0/character_count))

	return list([onegram_count,onegram_score,bigram_count,bigram_score,positive_count,negative_count,character_count,uppercase_count,lowercase_count,punctuation_count,alpha_count,num_count, upper_to_lower,alpha_to_char])